@canadian guy 1981 In that interview he also said - We are now transitioning — not there yet, but transitioning — to more of an endemicity, where the level of infection is low enough that people are starting to learn how to live with the virus, still protecting themselves by vaccination, by the availability of antivirals, by testing

and later clarified to NPR - he thinks the U.S. has passed the "acute component of the pandemic phase."

Context matters, clarity matters. Taking 1 soundbite without context shows you didn't bother to do the research.

